import React from 'react';

function RegisterItem(props){
    console.log(props)
    return(
        <div>
            <ul>
                {props.list.map((value, index) => {
                    <li key={index}>{value.titl}</li>
                })}
            </ul>
        </div>
    )
}

export default RegisterItem;

